import React from 'react';
import { Nav, Navbar, Form, FormControl } from 'react-bootstrap';
import styled from 'styled-components';

const Styles = styled.div`
  .navbar { background-color: #222; }
  a, .navbar-nav, .navbar-light .nav-link {
    color: #9FFFCB;
    &:hover { color: white; }
  }
  .navbar-brand {
    font-size: 1.4em;
    color: #9FFFCB;
    &:hover { color: white; }
  }
`;

export const NavigationBar = () => (
  <Styles>
    <Navbar expand="lg" variant="dark">
      <Navbar.Brand href="#home">
         <img
         src="../../../public/images/DeBestRoboticsLogo.png"
         width="30"
         height="30"
         className="d-inline-block align-top"
         alt="React Bootstrap logo"
         />
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="basic-navbar-nav"/>
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="ml-auto">
          <Nav.Item><Nav.Link href="/">The Team</Nav.Link></Nav.Item> 
          <Nav.Item><Nav.Link href="/about">Calender</Nav.Link></Nav.Item>
          <Nav.Item><Nav.Link href="/">Contact</Nav.Link></Nav.Item> 
          <Nav.Item><Nav.Link href="/about">About</Nav.Link></Nav.Item>
          <Nav.Item><Nav.Link href="/">Log In</Nav.Link></Nav.Item> 
        </Nav>
      </Navbar.Collapse>
    </Navbar>
  </Styles>
)

export default NavigationBar;
